山本漢方 お徳用 プアール茶<br>
深炒り・二度焙煎<br>
冷水・水だし<br>
発酵茶<br><br>

◎脂っこい食事が好きな方に◎<br><br>

・日本人の嗜好に合うよう遠火でゆっくりと焙煎して発酵臭を取り去り、まろやかな風味に仕上げました。 <br>
<br>
【作り方】<br><br>
★ホット場合★<br>
・ご使用中のきゅうすに1パックを入れて適宜の熱湯を注ぎます。<br>
・お茶の、出る前にそのお湯を捨て去り、2煎目からつくりだしてください。<br>
・濃い目をお好みの方は、ゆっくりと振り出し、薄い目をお好みの方は、手早く茶碗に注いでください。<br>
・3番だし、4番だしも、お好みに合わせてください。<br><br>
★アイスの場合★<br>
・やかんにて、沸騰したお湯約600ccの中へ、上記のお湯洗いしたパックを1パック入れ、火を止めて3～5分間以上放置適宜の色・香りがでた頃、パックを取り去りしばらく放置、温度を下げてからウォーターポットにつぎかえ、冷蔵庫に保管してください。<br><br>
★冷水だしの場合★<br>
・ウォーターポットの中へ、1パックを入れ、水約400ccを注ぎ、冷蔵庫に保存、約15～30分後冷水プアール茶になります。<br>
<br>
【使用上の注意】<br>
・プアール茶はツバキ科の植物で天然由来の皮脂成分を含みます。<br>
・その為、お茶面に脂質成分が油の様に浮くことがありますが、ご安心してご使用ください。<br>
・本品は天然物を使用しておりますので、虫、カビの発生を防ぐために、開封後はお早めに、ご使用ください。<br>
・なお、開封後は輪ゴム、またはクリップなどでキッチリと封を閉め、涼しい所に保管してください。<br>
・特に夏季は要注意です。<br><hr>


【名称】お茶<br><br>

【原材料名】プアール茶<br><br>

【原料原産地名】・中国<br><br>

【内容量】 5g×52バッグ(260g)<br><br>

【賞味期限】枠外上部に記載<br><br>

【保存方法】直射日光及び、高温多湿の所を避けて、涼しいところに保存してください。<br><br>

【製造者】山本漢方製薬株式会社<br>
愛知県小牧市多気東町157番地<br>TEL 0568-73-3131<hr>
